const Footer = () => {
    return (
        <FooterContainer>
            <FooterList>
                <a href="http://github.com/pedrogritter">
                    <i className="fab fa-github"></i>
                </a>
                <a href="https://www.linkedin.com/in/pedro-gritter/">
                    <i className="fab fa-linkedin"></i>
                </a>
            </FooterList>
        </FooterContainer>
    );
};

export default Footer;
